import { Jumbotron, Button, Container } from "reactstrap";
import BlogCard from "../Templates/BlogCard";

const Home = () => {
  const obj = {
    title: "Avengers",
    subtitle: "EndGame",
    description: "Love You 3000",
  };
  return (
    <React.Fragment>
      <br />
      <br />
      <br />
      <Container>
        <Row>
        <Col xs = "2"></Col>
        <Col xs = "6"></Col>
          <BlogCard
            title="Avengers"
            subtitle="EndGame"
            description="Marvel's The Avengers[6] (classified under the name Marvel Avengers Assemble in the United Kingdom and Ireland[3][7]), or simply The Avengers, is a 2012 American superhero film based on the Marvel Comics superhero team of the same name. Produced by Marvel Studios and distributed by Walt Disney Studios Motion Pictures,[N 1] it is the sixth film in the Marvel Cinematic Universe (MCU). Written and directed by Joss Whedon, it features an ensemble cast including Robert Downey Jr., Chris Evans, Mark Ruffalo, Chris Hemsworth, Scarlett Johansson, and Jeremy Renner as the Avengers, alongside Tom Hiddleston, Clark Gregg, Cobie Smulders, Stellan SkarsgÃ¥rd, and Samuel L. Jackson. In the film, Nick Fury and the spy agency S.H.I.E.L.D. recruit Tony Stark, Steve Rogers, Bruce Banner, and Thor to form a team capable of stopping Thor's brother Loki from subjugating Earth."
            media="https://picsum.photos/200/300"
            userName="Sunny"
          />
        <Col xs = "4"></Col>
        </Row>
      </Container>
    </React.Fragment>
  );
};

export default Home;
